import styled from "styled-components";

export const P = styled.p`
  font-size: ${(props) => props.style.size};
  font-weight: ${(props) => props.style.weight};
  color: ${(props) => props.style.type};
  margin-bottom: ${(props) => props.style.marginBottom};
`;
